      <thead>
        <tr>
          <th>product</th>
          <th>price</th>
          <th>count</th>
          <th>subtotal</th>
          <th>actions</th>
        </tr>
      </thead>
      <tbody>
        {
          cart.map(elm => {
            return <tr key={elm.id}>
              <td>{elm.name}</td>
              <td>{elm.price}</td>
              <td>{elm.count}</td>
              <td>{elm.count * elm.price}</td>
              <td><button onClick={() => countUP(elm)}>countUP</button>   <button onClick={() => Countdown(elm)}>count down</button> <button onClick={() => Delate(elm)}>Delate</button></td>

